const getUnique = (arrA, arrB, field) => {
    const arr = [...arrA, ...arrB];
    const unique = [];

    arr.forEach(item => {
        const listedInA = arrA.find(i => i[field] === item[field]);
        const listedInB = arrB.find(i => i[field] === item[field])
        const isUnique = !listedInA || !listedInB;

        if (isUnique) {
            unique.push(item);
        }
    });

    return unique;
}

